>
    <div class="absolute inset-0 bg-[url(/img/grid.svg)] bg-center [mask-image:linear-gradient(180deg,white,rgba(255,255,255,0))]"></div>
    <div class="relative bg-white px-6 pb-8 pt-10 shadow-xl ring-1 ring-gray-900/5 sm:mx-auto sm:max-w-lg sm:rounded-lg sm:px-10">
        <div class="mx-auto max-w-md">
            <div class="divide-y divide-gray-300/50">
                <p>
                    <span class="text-2xl font-bold">Dankjewel Arthur</span> voor alle jaren. We hebben samen en met het team veel leuke dingen gedaan. We hebben mooie interne projecten en klantprojecten mogen oppakken. Ik heb echt genoten van de grappige, bijzondere momenten die we samen hebben beleefd, en die zal ik niet snel vergeten.

                    <br /><br />

                    Ik heb veel plezier beleefd aan alle tooltjes, trucjes en Home Assistant-onderdelen, en ik zal daar vast nog wel eens om vragen. Bedankt voor alle ervaringen, de leuke breinbrekers en de waardevolle security-waarschuwingen!

                    <br /><br />

                    Ik ben benieuwd hoe jij het gaat beleven bij 123inkt, met een Windows-pc en een heel leuke Franse auto (of toch Duitse?).
                </p>
                <div class="pt-8 text-base font-semibold leading-7">
                    <p class="text-gray-900">Toch nog een leuk filmpje zien?</p>
                    <p>
                        <a href="https://youtu.be/dQw4w9WgXcQ?si=EAEkW1o8fzb1FnMo" target="_blank" class="text-blue-500 hover:text-sky-600">Bekijk het filmpje &rarr;</a>
                    </p>
